import Spacetourism from "./images/space-tourism.png";

import Spreadoperator from "./images/spread-operator.png";
import Timeapp from "./images/time-app.png";
import Tindog from "./images/tindog.png";
import Todolistv1 from "./images/to-do-list-v1.png";
import Todolistv2 from "./images/to-do-list-v2.png";

function Projects(){

  const [navIconClicked, setNavIconClicked] = useState("navbar-toggler-icon");
  const [isClicked, setIsClicked] = useState(false);

  const [fadeOutMenu, setFadeOutMenu] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });
  const [isMenuClicked, setIsMenuClicked] = useState(false);

  const [fadeOutEffect, setfadeOutEffect] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });

  const [normalH3, clickH3] = useState("Projects");
  
  const [projectListclass, setProjectListclass] = useState("carousel slide carousel-fade");

  const [faviconclass, setFaviconclass] = useState("logo");

  function handleClick(){
    if (!isClicked) {
      setNavIconClicked("navbarClicked");
      clickH3("");
      setIsClicked(true);
      setProjectListclass("hidden");
      setFaviconclass("hidden");
    }else{
      setNavIconClicked("navbarClicked2");
      clickH3("Projects");
      setIsClicked(false);
      setProjectListclass("carousel slide carousel-fade");
      setFaviconclass("logo");
    }

    if (!isMenuClicked) {
      setFadeOutMenu({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setfadeOutEffect({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setIsMenuClicked(true);
    }
    else{
      setFadeOutMenu({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setfadeOutEffect({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setIsMenuClicked(false);
    }
  };

    return (

      <>

<div className="overlay2">

      <section id="projects" className="skills-section color-443829">
            
            <h3 style={fadeOutEffect}>{normalH3}</h3>

<div style={fadeOutEffect} id="myCarousel" class={projectListclass} data-ride="carousel" data-interval="10000" data-pause="hover">
        
        <ol class="carousel-indicators">
          <li data-target="#myCarousel" data-slide-to="0" class="active"></li>
          <li data-target="#myCarousel" data-slide-to="1"></li>
          <li data-target="#myCarousel" data-slide-to="2"></li>
          <li data-target="#myCarousel" data-slide-to="3"></li>
          <li data-target="#myCarousel" data-slide-to="4"></li>
          <li data-target="#myCarousel" data-slide-to="5"></li>
          <li data-target="#myCarousel" data-slide-to="6"></li>
          <li data-target="#myCarousel" data-slide-to="7"></li>
          <li data-target="#myCarousel" data-slide-to="8"></li>
          <li data-target="#myCarousel" data-slide-to="9"></li>
          <li data-target="#myCarousel" data-slide-to="10"></li>
          <li data-target="#myCarousel" data-slide-to="11"></li>
          <li data-target="#myCarousel" data-slide-to="12"></li>
          <li data-target="#myCarousel" data-slide-to="13"></li>
          <li data-target="#myCarousel" data-slide-to="14"></li>
        </ol>
        
        <div class="carousel-inner">

          <div class="carousel-item active">
          <img class="slide-item first-slide" src={Spacetourism} alt="First slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item second-slide" src={Drumkit} alt="Second slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item third-slide" src={Simonsgame} alt="Third slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item fourth-slide" src={Tindog} alt="Fourth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item fifth-slide" src={Newslettersignup} alt="Fifth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item sixth-slide" src={Dicegame} alt="Sixth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item seventh-slide" src={Personalsite} alt="Seventh slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item eighth-slide" src={Blogwebsite} alt="Eighth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item ninth-slide" src={Emojipedia} alt="Ninth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item tenth-slide" src={Keeperapp} alt="Tenth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item eleventh-slide" src={Timeapp} alt="Eleventh slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item twelveth-slide" src={Todolistv1} alt="Twelveth slide" /> 
          </div>
          <div class="carousel-item">
          <img class="slide-item thirteenth-slide" src={Todolistv2} alt="Thirteenth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item fourteenth-slide" src={Spreadoperator} alt="Fourteeth slide" />
          </div>
          <div class="carousel-item">
          <img class="slide-item fifteenth-slide" src={Secretswebsite} alt="Fifteenth slide" />
          </div>

        </div>
        <a class="carousel-control-prev" href="#myCarousel" role="button" data-slide="prev">
          <span class="carousel-control-prev-icon" aria-hidden="true"></span>
          <span class="sr-only">Previous</span>
        </a>
        <a class="carousel-control-next" href="#myCarousel" role="button" data-slide="next">
          <span class="carousel-control-next-icon" aria-hidden="true"></span>
          <span class="sr-only">Next</span>
        </a>
      </div>

      </section>

  <header>

  <img class={faviconclass} src="logo/favicon.ico" />

  <div class="pos-f-t" id="my-navbar-collapse">
      <div class="collapse navbar-collapse" id="navbarToggleExternalContent">
        <div class="menu" style={fadeOutMenu}>
          <ul class="nav navbar-nav">
            <li>
              <a class="nav-link nav-links" href="/about">About</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="/skills">Skills & Tools</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="/projects">Projects</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="/contact">Contact</a>
            </li>
            <li>
              <a class="nav-link nav-links" href="Jeffin_Jaison_Resume.pdf">
              <svg class="download-button" xmlns="http://www.w3.org/2000/svg" width="25" height="25" viewBox="0 0 24 24"><path d="M19 9h-4V3H9v6H5l7 7 7-7zM5 18v2h14v-2H5z"/></svg>
              Resume</a>
            </li>
          </ul>
        </div>
      </div>
      <nav class="navbar navbar-dark">
        <button class="navbar-toggler" 
        type="button" 
        data-toggle="collapse" 
        data-target="#navbarToggleExternalContent"
        aria-controls="navbarToggleExternalContent"
        aria-expanded="false"
        aria-label="Toggle navigation"
        onClick={handleClick}>
          <span class={navIconClicked}></span>
        </button>
      </nav>
    </div>
  </header>

  </div>

</>

)};

export default Projects;
